https://code.visualstudio.com/docs/getstarted/keybindings#_when-clause-contexts

I would like to see us to use functions that are already defined and use existing path handling, instead of rewriting existing functions.

You can see that getWorkspaceFolderPath() uses the path modules "join()" to create the new path which should be safer.

Replace L:462 - L:469 with 
let dialogPath: string | undefined;
dialogPath = getWorkspaceFolderPath("components")
if (!await pathExists(dialogPath)) {
	dialogPath = getWorkspaceFolder().uri.fsPath;
}

For template literals you will need to close and open using a back tick "`" and concatenate with +

`Failed to query existing ${query} symbols ` +
`in workspace from language server. ${error}`);

We shouldn't be generating a function here.  Just the guts of the code of the read transaction itself.

We shouldn't just blindly copy the code examples from the APIs, we should be creating snippets that reflect how the user code will actually work.

For example this snippet should generate something like this:


    le_cfg_IteratorRef_t $0Ref = le_cfg_CreateReadTxn($1);

    // Call functions to read from the config tree, like le_cfg_GetString, le_cfg_GetInt.

    le_cfg_CancelTxn($0Ref);

